import React from "react";
import "./Index.css";
import { Link } from "react-router-dom";
import About from '../../'

const index = () => {
  return (
    <nav>
      <div className="navbar">
        <h1>Doodle Keep</h1>
        <div className="elements">
          <Link to={<About/>}>
            <li>Collection</li>
          </Link>
          <Link to='/history'>
            <li>History</li>
          </Link>
          <Link to='/about'>
            <li>About</li>
          </Link>
          <Link to='/help'>
            <li>Help</li>
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default index;
